import React, { useState } from 'react';
import './App.css';

function RegisterPage() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [phone, setPhone] = useState('');

  return (
    <div className="min-h-screen flex flex-col justify-center items-center bg-gray-100">
          <div className="absolute w-full h-full overflow-hidden">
        <img src="/rec.jpeg" alt="College Building" className="object-cover w-full h-full opacity-30" />
      </div>
      <div className="relative z-10 bg-purple-500 p-6 rounded-lg shadow-md max-w-md mx-auto mt-10">
        <h1 className="text-2xl font-bold mb-4 text-white">Register Page</h1>
        <div className="mb-4">
          <input
            type="text"
            placeholder="Username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </div>
        <div className="mb-4">
          <input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </div>
        <div className="mb-4">
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </div>
        <div className="mb-4">
          <input
            type="text"
            placeholder="Phone"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
            className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </div>
      </div>
    </div>
  );
}

export default RegisterPage;
